import React, { useState, useEffect, useCallback } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { useAuth } from '../App'; // Assuming you have a shared auth context
import './css/AdminDashboard.css';

const AdminDashboard = () => {
    const { user, logout } = useAuth(); // Or your admin-specific auth
    const [dashboardData, setDashboardData] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    const navigate = useNavigate();
    const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:8000';

    const fetchData = useCallback(async () => {
        setLoading(true);
        try {
            const response = await fetch(`${API_BASE_URL}/api/admin/dashboard/`);
            if (!response.ok) throw new Error("Failed to fetch dashboard data.");
            const data = await response.json();
            setDashboardData(data);
        } catch (err) {
            setError(err.message);
        } finally {
            setLoading(false);
        }
    }, [API_BASE_URL]);

    useEffect(() => {
        fetchData();
        const interval = setInterval(fetchData, 30000); // Refresh data every 30 seconds
        return () => clearInterval(interval);
    }, [fetchData]);

    if (loading) return <div className="panel-loader"><h2>Loading Command Center...</h2></div>;
    if (error) return <div className="error-message"><h2>Error</h2><p>{error}</p></div>;
    if (!dashboardData) return <div>No data available.</div>;

    const { station_data, registered_users, health_assessments } = dashboardData;

    return (
        <div className="main-wrapper">
            <aside className="sidebar">
                <div className="sidebar-header">
                    <h1 className="sidebar-title">AQI Monitoring</h1>
                </div>
                <ul className="nav flex-column">
                    <li className="nav-item"><a className="nav-link active" href="#"><i className="fas fa-tachometer-alt nav-icon"></i><span className="nav-text">Dashboard</span></a></li>
                    <li className="nav-item"><a className="nav-link" href="#"><i className="fas fa-wifi nav-icon"></i><span className="nav-text">Stations</span></a></li>
                    <li className="nav-item"><a className="nav-link" href="#"><i className="fas fa-users nav-icon"></i><span className="nav-text">Registered Users</span></a></li>
                    <li className="nav-item"><a className="nav-link" href="#"><i className="fas fa-heartbeat nav-icon"></i><span className="nav-text">Health Assessments</span></a></li>
                    {/* Add other nav links from your HTML */}
                </ul>
            </aside>

            <main className="content-area">
                <div className="topbar">
                    <h1 className="topbar-title">Command Center</h1>
                    <div className="user-dropdown">
                        <div className="user-avatar"><i className="fas fa-user"></i></div>
                        <span className="user-name">Admin</span>
                    </div>
                </div>

                <div className="station-grid">
                    {Object.entries(station_data).map(([id, station]) => (
                        <div className="dashboard-card" key={id}>
                            <div className="card-header">
                                <h5 className="card-title">{station.latest_item?.station_name || id.replace('_', ' ').toUpperCase()}</h5>
                                <span className="status-badge status-normal">Active</span>
                            </div>
                            <div className="card-body">
                                <p><strong>Current AQI:</strong> {Math.round(station.aqi || 0)}</p>
                                <p><strong>PM2.5:</strong> {station.latest_item?.pm25 || 'N/A'} µg/m³</p>
                                <p><strong>PM10:</strong> {station.latest_item?.pm10 || 'N/A'} µg/m³</p>
                                {/* Add other pollutant values */}
                            </div>
                        </div>
                    ))}
                </div>

                <div className="data-card" id="register">
                    <div className="card-header">
                        <h4 className="card-title"><i className="fas fa-users"></i> Registered Users <span className="badge-count">{registered_users.length}</span></h4>
                    </div>
                    <div className="card-body p-0">
                        <table className="data-table">
                            <thead><tr><th>ID</th><th>Name</th><th>Phone Number</th><th className="text-center">Actions</th></tr></thead>
                            <tbody>
                                {registered_users.map(u => (
                                    <tr key={u.id}>
                                        <td>#{u.id}</td>
                                        <td>{u.name}</td>
                                        <td>{u.phone_number}</td>
                                        <td className="action-buttons">
                                            <button className="action-button view" title="View"><i className="fas fa-eye"></i></button>
                                            <button className="action-button edit" title="Edit"><i className="fas fa-edit"></i></button>
                                            <button className="action-button delete" title="Delete"><i className="fas fa-trash"></i></button>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>

                <div className="data-card" id="healthassessment">
                    <div className="card-header">
                        <h4 className="card-title"><i className="fas fa-heartbeat"></i> Health Assessments <span className="badge-count">{health_assessments.length}</span></h4>
                    </div>
                    <div className="card-body p-0">
                        <table className="data-table">
                            <thead><tr><th>ID</th><th>Username</th><th>Age Group</th><th>Gender</th><th>Score</th><th className="text-center">Actions</th></tr></thead>
                            <tbody>
                                {health_assessments.map(h => (
                                    <tr key={h.id}>
                                        <td>#{h.id}</td>
                                        <td>{h.user__name}</td>
                                        <td>{h.age_group}</td>
                                        <td>{h.gender}</td>
                                        <td>
                                            <span className={`health-score ${h.health_score > 70 ? 'health-score-high' : h.health_score > 40 ? 'health-score-medium' : 'health-score-low'}`}>
                                                {h.health_score}
                                            </span>
                                        </td>
                                        <td className="action-buttons">
                                             <button className="action-button view" title="View"><i className="fas fa-eye"></i></button>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>

            </main>
        </div>
    );
};

export default AdminDashboard;
